import axios from "axios";


class CourseService {


    async getCourses() {

        const axiosConfig = {
            headers: {
                'Content-Type': 'application/json;charset=UTF-8',
                "Access-Control-Allow-Origin": "*",
            }
        };

        const response = await axios.get("http:localhost:8080/course/", axiosConfig);
        return response;
    }


}

export default new CourseService();
